import React from 'react';
import { Helmet } from 'react-helmet';
import styled from 'styled-components';

const Container = styled.div`
  padding: 2rem;
  max-width: 1200px;
  margin: auto;
  text-align: left;

  iframe {
    width: 100%;
    height: 80vh;
    border: none;
  }
`;

const HTMLProject = () => (
  <Container>
    <Helmet>
      <title>Exponential Data Analysis with R - Data Science Portfolio</title>
    </Helmet>
    <h1>Exponential Data Analysis with R</h1>
    <iframe src="https://github.com/issa24/Data-Science/blob/main/ExpodatawithR.html" title="Exponential Data Analysis with R"></iframe>
  </Container>
);

export default HTMLProject;
